import React from 'react';
const MetaContext = React.createContext<{ darkMode: boolean, SERVER_URL: string, token: string }>({ darkMode: true, SERVER_URL: "", token: "" });
export const ThingsProvider = MetaContext.Provider;
export default MetaContext;
